DROP TABLE IF EXISTS MultipleDiseases;
CREATE TABLE MultipleDiseases(
   `Year`                  INTEGER  NOT NULL PRIMARY KEY 
  ,`State`                 VARCHAR(20)
  ,`Diseases`              VARCHAR(99) NOT NULL
  ,`Deaths`                INTEGER  NOT NULL
  ,`Population`            INTEGER  NOT NULL
  ,`Crude_Rate`            VARCHAR(10) NOT NULL
  ,`Total_Deaths_percentage` VARCHAR(7) NOT NULL
);
